function createGround(width, height){
  var result = [];
  for (var i = 0 ; i < width; i++) {
      result[i] = [];
      for (var j = 0; j < height; j++) {
          result[i][j] = Math.random();
      }
  }
  return result;
}

function base64DecToArr (sBase64, nBlockSize) {

    var
      sB64Enc = sBase64.replace(/[^A-Za-z0-9\+\/]/g, ""), nInLen = sB64Enc.length,
      nOutLen = nBlockSize ? Math.ceil((nInLen * 3 + 1 >>> 2) / nBlockSize) * nBlockSize : nInLen * 3 + 1 >>> 2, aBytes = new Uint8Array(nOutLen);
  
    for (var nMod3, nMod4, nUint24 = 0, nOutIdx = 0, nInIdx = 0; nInIdx < nInLen; nInIdx++) {
      nMod4 = nInIdx & 3;
      nUint24 |= b64ToUint6(sB64Enc.charCodeAt(nInIdx)) << 18 - 6 * nMod4;
      if (nMod4 === 3 || nInLen - nInIdx === 1) {
        for (nMod3 = 0; nMod3 < 3 && nOutIdx < nOutLen; nMod3++, nOutIdx++) {
          aBytes[nOutIdx] = nUint24 >>> (16 >>> nMod3 & 24) & 255;
        }
        nUint24 = 0;
      }
    }
  
    return aBytes;
  }

  function b64ToUint6 (nChr) {

    return nChr > 64 && nChr < 91 ?
        nChr - 65
      : nChr > 96 && nChr < 123 ?
        nChr - 71
      : nChr > 47 && nChr < 58 ?
        nChr + 4
      : nChr === 43 ?
        62
      : nChr === 47 ?
        63
      :
        0;
  
  }

function doTsne(dists){
    var dfrd1 = $.Deferred();

    setTimeout(function(){
      // doing async stuff
      //kaparthy tsne
      var opt = {}
      opt.epsilon = 10; // epsilon is learning rate (10 = default)
      opt.perplexity = 30; // roughly how many neighbors each point influences (30 = default)
      opt.dim = 3; // dimensionality of the embedding (2 = default)
      var tsne = new tsnejs.tSNE(opt);
      tsne.initDataDist(dists);
      for(var k = 0; k < 500; k++) {
        tsne.step(); // every time you call this, solution gets better
      }
      coordinates = tsne.getSolution();// Y is an array of 2-D points that you can plot
      dfrd1.resolve();
    }, 1000);
    return dfrd1.promise();
}


function loadFiles(){
  var vertices = [];
  var sampleURI;
  var imageVector;

  var count = 0;
  //load post files
  Object.keys(requestData).forEach(function(key) {
    requestData[key].forEach(function (arrayItem) {

        vertices = [];
        geo = new THREE.BufferGeometry();

        var x = coordinates[count][0]*10000000000;
        var y = coordinates[count][1]*10000000000;
        var z = coordinates[count][2]*10000000000;

        console.log(x,y,z);


        vertices.push( x, y, z );
        geo.addAttribute( 'position', new THREE.Float32BufferAttribute( vertices, 3 ) );
        
        sampleURI = arrayItem;
        mat = new THREE.PointsMaterial( { size: 100, map: textureLoader.load(sampleURI)} );
        var particles = new THREE.Points( geo, mat );

        particles.rotation.x = Math.random() * 6;
        scene.add( particles );

        count++;
    });
  });

}

